import { Component } from 'react';
import Picker from '../components/picker'

class Home extends Component {
    render() {
        const age = 26
        const hobbies = ['睡觉', '吃饭']
        const fn =(data)=>{
            console.log('支持下',data)
        }
        return (
            <div className="Home">
                <Picker age={age} hobbies={hobbies} fn={fn}/>
            </div>
        );
    }
}
export default Home;
